const buttonStyle = {
    justifyContent: "center"
};

function Home() {
    return (
        <form>
            <div className="form-row">
                <div className="col">
                    <label htmlFor="exampleDate">Дата подачи</label>
                    <input type="text" className="form-control" id="exampleDate" placeholder="Дата вывоза"/>
                </div>
                <div className="col">
                    <label htmlFor="exampleDate">Дата завершения</label>
                    <input type="text" className="form-control" id="exampleDate" placeholder="Дата вывоза"/>
                </div>
            </div>
        </form>
    );
}

export default Home;
